// App.js - główny plik routingu
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import LoginForm from './components/LoginForm';
import RegistrationForm from './components/RegistrationForm';
import Start from './components/Start'
import Home from './components/Home';
import Chords from './components/Chords'
import Navigation from './components/Navbar';
import ChordsForm from './components/ChordsForm';
//import routes from './components/routes'; // Zaimportuj zdefiniowane trasy


const App = () => {
  return (
    <Router>
      <div>
        <Navigation />
      <Routes>
        <Route path="/" element={<Start />} />
        <Route path="/users/login" element={<LoginForm />} />
        <Route path="/users/register" element={<RegistrationForm />} />
        <Route path="/home" element={<Home />} />
        <Route path="/chords" element={<Chords />} />
        <Route path="/chordsform" element={<ChordsForm />} />
        {/* Inne trasy */}
      </Routes>
      </div>
    </Router>
  );
};

export default App;
